import { useState } from "react";
import "./Form.css";

function Form() {
  const [result, setResult] = useState(" ");
  return (
    <form className="wrap">
      <input type="text" value={result} />
      <button>Clear</button>
      <button>C</button>
      <button>/</button>
      <button>7</button>
      <button>8</button>
      <button>9</button>
      <button>x</button>
      <button>4</button>
      <button>5</button>
      <button>6</button>
      <button>-</button>
      <button>1</button>
      <button>2</button>
      <button>3</button>
      <button>+</button>
      <button>0</button>
      <button>.</button>
      <button>=</button>
    </form>
  );
}

export default Form;
